import React from 'react';
import PropTypes from 'prop-types';
import { generateLeagueFixtures, generatePreSeasonFixtures, turkishLeagues } from '../data';

const FixtureModal = ({ setShowFixture, club }) => {
  // Seçilen takımın ligindeki tüm takımlar için fikstür oluştur
  const leagueTeams = turkishLeagues[club.league] || [];
  const leagueFixtures = generateLeagueFixtures(leagueTeams, club.league);

  // Seçilen takımın lig maçlarını filtrele
  const teamLeagueFixtures = leagueFixtures.filter(fixture => 
    fixture.homeTeam === club.name || fixture.awayTeam === club.name
  ).slice(0, 10); // İlk 10 maçı göster

  // Hazırlık maçları oluştur
  const preSeasonFixtures = generatePreSeasonFixtures(club.name);

  const getResult = (fixture) => {
    if (!fixture.homeScore && !fixture.awayScore) return null; // Henüz oynanmamış

    if (fixture.homeTeam === club.name) {
      if (fixture.homeScore > fixture.awayScore) return 'G';
      if (fixture.homeScore < fixture.awayScore) return 'M';
      return 'B';
    } else {
      if (fixture.awayScore > fixture.homeScore) return 'G';
      if (fixture.awayScore < fixture.homeScore) return 'M';
      return 'B';
    }
  };

  const getResultColor = (result) => {
    if (result === 'M') return 'var(--loss)';
    if (result === 'G') return 'var(--win)';
    if (result === 'B') return 'var(--draw)';
    return '#ccc';
  };

  const renderFixtureRow = (fixture, index) => {
    const isHome = fixture.homeTeam === club.name;
    const result = getResult(fixture);
    const score = fixture.homeScore !== null && fixture.awayScore !== null 
      ? `${fixture.homeScore} - ${fixture.awayScore}` 
      : 'Henüz oynanmadı';

    return (
      <tr key={index}>
        <td>{fixture.isPreSeason ? `Hazırlık ${Math.abs(fixture.matchday)}` : `Hafta ${fixture.matchday}`}</td>
        <td style={{ fontWeight: isHome ? 'bold' : 'normal' }}>
          {fixture.homeTeam}
        </td>
        <td>{score}</td>
        <td style={{ fontWeight: !isHome ? 'bold' : 'normal' }}>
          {fixture.awayTeam}
        </td>
        <td>
          {result ? (
            <span 
              style={{ 
                background: getResultColor(result),
                color: '#fff',
                padding: '2px 8px',
                borderRadius: '4px',
                fontWeight: 'bold'
              }}
            >
              {result}
            </span>
          ) : (
            <span style={{ color: '#999', fontSize: '12px' }}>-</span>
          )}
        </td>
      </tr>
    );
  };

  return (
    <div className="fc-modal-backdrop">
      <div className="fc-modal">
        <h3>FİKSTÜR - {club.name}</h3>

        {/* Hazırlık Maçları */}
        <div className="fc-panel" style={{ marginBottom: '20px' }}>
          <h4 style={{ margin: '0 0 15px 0', textAlign: 'center', color: 'var(--gold)' }}>
            HAZIRLIK MAÇLARI
          </h4>
          <table className="fc-table">
            <thead>
              <tr>
                <th>Maç</th>
                <th>Ev Sahibi</th>
                <th>Skor</th>
                <th>Deplasman</th>
                <th>Sonuç</th>
              </tr>
            </thead>
            <tbody>
              {preSeasonFixtures.map((fixture, index) => renderFixtureRow(fixture, index))}
            </tbody>
          </table>
        </div>

        {/* Lig Maçları */}
        <div className="fc-panel">
          <h4 style={{ margin: '0 0 15px 0', textAlign: 'center', color: 'var(--blue)' }}>
            LİG MAÇLARI - {club.league}
          </h4>
          <table className="fc-table">
            <thead>
              <tr>
                <th>Hafta</th>
                <th>Ev Sahibi</th>
                <th>Skor</th>
                <th>Deplasman</th>
                <th>Sonuç</th>
              </tr>
            </thead>
            <tbody>
              {teamLeagueFixtures.map((fixture, index) => renderFixtureRow(fixture, index))}
            </tbody>
          </table>
        </div>

        <div className="fc-footerbar">
          <button className="fc-btn" onClick={() => setShowFixture(false)}>Geri</button>
        </div>
      </div>
    </div>
  );
};

FixtureModal.propTypes = {
  setShowFixture: PropTypes.func.isRequired,
  club: PropTypes.object.isRequired,
};

export default FixtureModal;
